import 'bootstrap/dist/css/bootstrap.min.css'
import {Nav, Container, Navbar} from 'react-bootstrap'

function NavBar() {
    return(
        <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        </Container>
      </Navbar>
    );
}

export default NavBar;
